package main

func SpecialFactorial(n int) int {
	result := 1

	// Calculate n! * (n-1)! * (n-2)! * ... * 1!
	for i := n; i >= 1; i-- {
		// Calculate i! and multiply it to result
		factorial := 1
		for j := i; j >= 1; j-- {
			factorial *= j
		}
		result *= factorial
	}

	return result
}
